import './App.css';
import HomePage from './Pages/homepage/homepage.js';
import { Route } from 'react-router-dom';

const HatsPage = () => (
  <div>
    <h1>HatsPage</h1>
  </div>
);

function App() {
  return (
    <div>
        {/* <HomePage/> */}
        <Route path='/' component={HomePage} />
        <Route exact path='/hats' component={HatsPage} />
    </div>
  );
}

export default App;
